INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (4, 1110501043, 0, 0, 1110501, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 111011, 1, 11, 1, "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES ("", 1110501044, "", "", 1110501, "", 0, "", 91, "", "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (0, 1110501045, "", "", 1110501, "vo_adv_1110501_002", "vo_adv_1110501", 0, 21, "", "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (4, 1110501046, 0, 0, 1110501, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 111011, 1, 11, 1, "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES ("", 1110501047, "", "", 1110501, "", 0, "", 91, "", "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (0, 1110501048, "", "", 1110501, "vo_adv_1110501_003", "vo_adv_1110501", 0, 21, "", "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (5, 1110501049, 0, 0, 1110501, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 111011, 1, 11, 1, "");
INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES ("", 1110501050, "", "", 1110501, "", 0, "", 91, "", "");
